import React, { useState } from 'react';
import ParkingMap from './components/ParkingMap';
import './App.css'; // Pastikan file CSS diimpor

const App = () => {
  const [spots, setSpots] = useState([
    { id: 1, status: 'available' },
    { id: 2, status: 'occupied' },
    { id: 3, status: 'available' },
    { id: 4, status: 'occupied' },
    { id: 5, status: 'available' },
    { id: 6, status: 'available' },
    { id: 7, status: 'occupied' },
    { id: 8, status: 'available' },
  ]);

  const [selectedSpot, setSelectedSpot] = useState(null);
  const [customerName, setCustomerName] = useState('');
  const [vehicleNumber, setVehicleNumber] = useState('');
  const [bookingDuration, setBookingDuration] = useState('');
  const [errorMessage, setErrorMessage] = useState('');
  const [bookingSuccess, setBookingSuccess] = useState('');

  // Fungsi untuk menangani klik pada tempat parkir
  const handleSpotClick = (id) => {
    setSpots((prevSpots) =>
      prevSpots.map((spot) =>
        spot.id === id
          ? { ...spot, status: spot.status === 'available' ? 'occupied' : 'available' }
          : spot
      )
    );
  };

  // Fungsi untuk menangani pemilihan tempat parkir
  const handleSpotSelection = (e) => {
    const spotId = parseInt(e.target.value);
    setSelectedSpot(spotId);
    const spot = spots.find((spot) => spot.id === spotId);
    if (spot.status === 'occupied') {
      setErrorMessage('Tempat parkir sudah terisi');
    } else {
      setErrorMessage('');
    }
  };

  // Fungsi untuk menangani pengiriman formulir
  const handleSubmit = (e) => {
    e.preventDefault();
    if (selectedSpot && spots.find((spot) => spot.id === selectedSpot).status === 'available') {
      setBookingSuccess(`Pemesanan berhasil untuk tempat parkir P${selectedSpot}`);
      // Update status parkir
      setSpots((prevSpots) =>
        prevSpots.map((spot) =>
          spot.id === selectedSpot ? { ...spot, status: 'occupied' } : spot
        )
      );
    } else {
      setBookingSuccess('');
      setErrorMessage('Gagal memesan tempat parkir. Pastikan tempat parkir tersedia.');
    }
  };

  return (
    <div className="container mt-4">
      <h1 className="text-center mb-4">Sistem Parkiran</h1>

      <div className="row">
        {/* Kolom Peta Parkiran */}
        <div className="col-md-6">
          <div className="canvas-container">
            <ParkingMap spots={spots} onSpotClick={handleSpotClick} />
          </div>
        </div>

        {/* Kolom Formulir Pemesanan */}
        <div className="col-md-6 booking-form">
          <div className="mt-4">
            <h3>Formulir Pemesanan</h3>
            <form onSubmit={handleSubmit}>
              <div className="form-group">
                <label htmlFor="name">Nama:</label>
                <input
                  type="text"
                  id="name"
                  className="form-control"
                  value={customerName}
                  onChange={(e) => setCustomerName(e.target.value)}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="vehicleNumber">Nomor Kendaraan:</label>
                <input
                  type="text"
                  id="vehicleNumber"
                  className="form-control"
                  value={vehicleNumber}
                  onChange={(e) => setVehicleNumber(e.target.value)}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="spotSelection">Pilih Tempat Parkir:</label>
                <select
                  id="spotSelection"
                  className="form-control"
                  value={selectedSpot || ''}
                  onChange={handleSpotSelection}
                  required
                >
                  <option value="" disabled>
                    Pilih Tempat Parkir
                  </option>
                  {spots.map((spot) => (
                    <option key={spot.id} value={spot.id}>
                      P{spot.id} {spot.status === 'occupied' ? '(Terisi)' : '(Tersedia)'}
                    </option>
                  ))}
                </select>
              </div>

              {errorMessage && <div className="alert alert-danger mt-2">{errorMessage}</div>}
              {bookingSuccess && <div className="alert alert-success mt-2">{bookingSuccess}</div>}

              <div className="form-group">
                <label htmlFor="bookingDuration">Durasi Parkir (jam):</label>
                <input
                  type="number"
                  id="bookingDuration"
                  className="form-control"
                  value={bookingDuration}
                  onChange={(e) => setBookingDuration(e.target.value)}
                  required
                />
              </div>

              <button type="submit" className="btn btn-primary mt-3">
                Pesan Tempat Parkir
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
